  <script>
    "use strict"

    var tl = new TimelineLite();
//houses
    tl.from($('.house'), 2, {
      opacity: 0,
      delay: 0.5
    }, 0); 
    
//clouds    
    tl.from($('.leftclouds'), 2, {
      opacity: 0,
      x: -50
    }, 0);
    tl.from($('.rightclouds'), 2, {
      opacity: 0,
      x: 50
    }, 0);
    tl.fromTo($('.leftline1'), 2, {
      x: -20
    }, {
      x: 0,
      yoyo: true,
      repeat: -1
    }, 0);
    tl.fromTo($('.leftline2'), 3, {
      x: -30
    }, {
      x: 0,
      delay: 0.5,
      yoyo: true,
      repeat: -1
    }, 0);
    tl.fromTo($('.rightcloud1'), 3, {
      x: -30
    }, {
      x: 0,
      yoyo: true,
      repeat: -1
    }, 0);
    tl.fromTo($('.leftcloud1'), 2, {
      y: 0
    }, {
      y: -10,
      yoyo: true,
      repeat: -1
    }, 0);
    tl.fromTo($('.leftcloud2'), 2, {
      y: 0
    }, {
      y: -10,
      yoyo: true,
      repeat: -1,
      delay: 0.5
    }, 0);
    tl.fromTo($('.rightcloud2'), 2, {
      y: 0
    }, {
      y: 10,
      yoyo: true,
      repeat: -1
    }, 0);
    tl.fromTo($('.rightcloud3'), 2, {
      y: 0
    }, {
      y: -10,
      yoyo: true,
      repeat: -1
    }, 0);
  
//trees  
    tl.from($('.btree1, .btree2'), 2, {
      opacity: 0,
      delay: 1,
      y: 50
    }, 0);
    tl.from($('.tree1, .tree2'), 2, {
      opacity: 0,
      delay: 1.5,
      y: 50
    }, 0);

    tl.fromTo($('.tree1'), 2, {
      rotationY: 20
    }, {
      rotationY: 0,
      yoyo: true,
      repeat: -1
    }, 0);
    tl.fromTo($('.tree2'), 2, {
      rotationY: 20
    }, {
      rotationY: 0,
      yoyo: true,
      repeat: -1,
      delay: 0.5
    }, 0);
//church    
    tl.from($('.church'), 2, {
      opacity: 0,
      delay: 2,
      y: 100
    }, 0);
  </script>
